import React from 'react';
import logo from './logo.svg';
import './App.css';
import countryData from './countrydata.json';

const App = () => {

  const dateObj = new Date();
  let date = new Date().toUTCString().slice(5, 16);
  var todaysSeed = require(date).create();
  todaysSeed.initState();
  var todaysNumber = todaysSeed(countryData.length);

  return (
    <div>
        [countryData[todaysNumber]]
    </div>
  );
}

export default App;
